import React, {Component} from 'react';

import ItemCard from './ItemCard/ItemCard';
import classes from './ItemCards.css';
import Card from 'react-bootstrap/Card';

class ItemCards extends Component {
    render() {
        let elements = []
        for (let i = 0; i<(this.props.productsList).length; i++){
            console.log(this.props.productsList[i])
            elements.push(<ItemCard product={this.props.productsList[i]}/>);
        }

    return (
        <div className={classes.Cards}
            style={{
                paddingTop: '70px',
                paddingLeft: '100px'
            }}>
            <div class="row">
                {elements}
            </div>
        </div>
    )}
};

export default ItemCards;
